regex_split <- function(s1, s2) {
    if (nchar(s2) == 0)
        s1 <- "."
    ret <- c()
    remaining <- s2
    m <- str_locate(remaining, s1)
    while (!is.na(m[1])) {
        prefix <- substr(remaining, 1, m[1] - 1)
        if (nchar(prefix) > 0)
            ret <- c(ret, prefix)
        ret <- c(ret, substr(remaining, m[1], m[2]))
        remaining <- substr(remaining, m[2] + 1, nchar(remaining))
        m <- str_locate(remaining, s1)
    }
    if (nchar(remaining) > 0)
        ret <- c(ret, remaining)
    return(ret)
}

